import './App.css';
import React from 'react'
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import Header from './components/header/header';
// import Navbar from './components/navbar/navbar';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path='/' element></Route>
        </Routes>

      </BrowserRouter>
    </div>
  );
}

export default App;
